id.description:
Identifier of a compliance property.

&#8291;

Examples:

&#8291;

&#8291;1.  Only funds compliant to ALL of the following: (1), (2), and (3) are considered:

`"compliance":{ "fund": { "or": [{ "and": [{ "id":1, "negate":false }, {"id":2, "negate":false}, {"id":3, "negate":false}]}]}}`

&#8291;

&#8291;2. Only funds compliant to either (1) or to (2) are considered:

`"compliance":{ "fund": { "or": [{ "and": [{ "id":1, "negate":false  }]}, {"and": [{ "id":2, "negate":false }]}]}}`

&#8291;

&#8291;3. Only funds compliant to (1) or to (2), but not compliant to (3) are considered:

`"compliance":{ "fund": { "or": [{ "and": [{ "id":1, "negate":false },{"id":3, "negate":true}]}, {"and": [{ "id":2, "negate":false},{"id":3, "negate":true}]}]}}`

